import React from 'react';
import TodoItem from './TodoItem';

function TodoList(props) {
  return (
    <div>
      {props.todos.map(todo => <TodoItem key={todo.id} todo={todo} toggleCompleted={props.toggleCompleted} />)}
    </div>
  );
}

export default TodoList;
